import React, { useState, useEffect } from 'react';

function App() {
  const [tasks, setTasks] = useState([]); // Task list
  const [taskInput, setTaskInput] = useState(''); // Input for new tasks
  const [filter, setFilter] = useState('all'); // Task filter: all, completed, incomplete

  // Load tasks when the app starts
  useEffect(() => {
    loadTasks();
  }, []);

  // Save tasks whenever they change
  useEffect(() => {
    saveTasks();
  }, [tasks]);

  // Load tasks from localStorage
  const loadTasks = () => {
    try {
      const storedTasks = localStorage.getItem('tasks');
      if (storedTasks) {
        setTasks(JSON.parse(storedTasks));
      }
    } catch (error) {
      console.error('Failed to load tasks:', error);
    }
  };

  // Save tasks to localStorage
  const saveTasks = () => {
    try {
      localStorage.setItem('tasks', JSON.stringify(tasks));
    } catch (error) {
      console.error('Failed to save tasks:', error);
    }
  };

  // Add a new task
  const addTask = () => {
    if (taskInput.trim()) {
      const newTask = { id: Date.now(), text: taskInput, completed: false };
      setTasks([...tasks, newTask]);
      setTaskInput('');
    }
  };

  // Toggle task completion
  const toggleTask = (id) => {
    setTasks(tasks.map((task) => (task.id === id ? { ...task, completed: !task.completed } : task)));
  };

  // Delete a task
  const deleteTask = (id) => {
    setTasks(tasks.filter((task) => task.id !== id));
  };

  // Filter tasks based on the current filter
  const getFilteredTasks = () => {
    switch (filter) {
      case 'completed':
        return tasks.filter((task) => task.completed);
      case 'incomplete':
        return tasks.filter((task) => !task.completed);
      default:
        return tasks;
    }
  };

  return (
    <div style={styles.container}>
      <h1 style={styles.title}>Todo List</h1>

      {/* Task Input */}
      <div style={styles.inputContainer}>
        <input
          style={styles.input}
          type="text"
          placeholder="Add a new task..."
          value={taskInput}
          onChange={(e) => setTaskInput(e.target.value)}
        />
        <button style={styles.addButton} onClick={addTask}>
          Add
        </button>
      </div>

      {/* Task Filters */}
      <div style={styles.filterContainer}>
        {['all', 'completed', 'incomplete'].map((f) => (
          <button
            key={f}
            style={{
              ...styles.filterButton,
              ...(filter === f ? styles.activeFilter : {}),
            }}
            onClick={() => setFilter(f)}
          >
            {f.charAt(0).toUpperCase() + f.slice(1)}
          </button>
        ))}
      </div>

      {/* Task List */}
      <ul style={styles.taskList}>
        {getFilteredTasks().map((task) => (
          <li key={task.id} style={styles.taskItem}>
            <span
              style={{
                ...styles.taskText,
                ...(task.completed ? styles.completedTask : {}),
              }}
              onClick={() => toggleTask(task.id)}
            >
              {task.text}
            </span>
            <button style={styles.deleteButton} onClick={() => deleteTask(task.id)}>
              Delete
            </button>
          </li>
        ))}
      </ul>
    </div>
  );
}

// Inline styles
const styles = {
  container: {
    maxWidth: '600px',
    margin: '0 auto',
    padding: '20px',
    backgroundColor: '#f8f9fa',
    borderRadius: '8px',
    boxShadow: '0 4px 8px rgba(0, 0, 0, 0.1)',
  },
  title: {
    textAlign: 'center',
    color: '#333',
  },
  inputContainer: {
    display: 'flex',
    marginBottom: '20px',
  },
  input: {
    flex: '1',
    padding: '10px',
    border: '1px solid #ccc',
    borderRadius: '4px',
  },
  addButton: {
    marginLeft: '10px',
    backgroundColor: '#28a745',
    color: '#fff',
    border: 'none',
    borderRadius: '4px',
    padding: '10px 15px',
    cursor: 'pointer',
  },
  filterContainer: {
    display: 'flex',
    justifyContent: 'center',
    marginBottom: '10px',
  },
  filterButton: {
    padding: '8px 12px',
    margin: '0 5px',
    borderRadius: '4px',
    backgroundColor: '#e0e0e0',
    border: 'none',
    cursor: 'pointer',
  },
  activeFilter: {
    backgroundColor: '#007bff',
    color: '#fff',
  },
  taskList: {
    listStyleType: 'none',
    padding: 0,
  },
  taskItem: {
    display: 'flex',
    justifyContent: 'space-between',
    alignItems: 'center',
    padding: '10px',
    borderBottom: '1px solid #ddd',
    backgroundColor: '#fff',
    borderRadius: '4px',
    marginBottom: '5px',
  },
  taskText: {
    cursor: 'pointer',
  },
  completedTask: {
    textDecoration: 'line-through',
    color: '#6c757d',
  },
  deleteButton: {
    backgroundColor: '#dc3545',
    color: '#fff',
    border: 'none',
    borderRadius: '4px',
    padding: '5px 10px',
    cursor: 'pointer',
  },
};

export default App;
